import {useState} from 'react'

const Square = ({ value }) => {
    const [clicked, setClicked] = useState(false);

    const handleClick = () => {
        console.log('clicked!')
    }
    return (<button className="square" onClick={handleClick}>{value}</button>);
}

export default Square;
